/*Table structure for table `tbl_studentinvoice` */

DROP TABLE IF EXISTS `tbl_studentinvoice`;

CREATE TABLE `tbl_studentinvoice` (
  `invoice_id` int(11) NOT NULL AUTO_INCREMENT,
  `invoice_number` varchar(255) DEFAULT NULL,
  `student_id` int(11) DEFAULT NULL,
  `status` varchar(255) DEFAULT 'unpaid',
  `amount` varchar(255) DEFAULT NULL,
  `date_added` datetime DEFAULT current_timestamp(),
  PRIMARY KEY (`invoice_id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=latin1;

/*Data for the table `tbl_studentinvoice` */

insert  into `tbl_studentinvoice`(`invoice_id`,`invoice_number`,`student_id`,`status`,`amount`,`date_added`) values (1,'INV2020-0001',1,'partial','3560','2020-03-15 00:03:33');

/*Table structure for table `tbl_studentmembership` */

DROP TABLE IF EXISTS `tbl_studentmembership`;

CREATE TABLE `tbl_studentmembership` (
  `studmem_id` int(11) NOT NULL AUTO_INCREMENT,
  `student_id` int(11) NOT NULL DEFAULT 0,
  `year` year(4) DEFAULT 2000,
  `membership_type` text DEFAULT NULL,
  `membership_price` varchar(255) DEFAULT NULL,
  `insurance` text DEFAULT NULL,
  `invoice_id` int(11) DEFAULT 0,
  `branch_id` int(11) DEFAULT NULL,
  `date_added` datetime NOT NULL DEFAULT current_timestamp(),
  PRIMARY KEY (`studmem_id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=latin1;

/*Data for the table `tbl_studentmembership` */

insert  into `tbl_studentmembership`(`studmem_id`,`student_id`,`year`,`membership_type`,`membership_price`,`insurance`,`invoice_id`,`branch_id`,`date_added`) values (1,1,2020,'1','500','{\"avail\":1,\"price\":60}',1,NULL,'2020-03-15 00:03:33');

/*Table structure for table `tbl_studentpackages` */

DROP TABLE IF EXISTS `tbl_studentpackages`;

CREATE TABLE `tbl_studentpackages` (
  `studpack_id` int(11) NOT NULL AUTO_INCREMENT,
  `student_id` int(11) DEFAULT 0,
  `invoice_id` int(11) DEFAULT 0,
  `package_id` int(11) DEFAULT 0,
  `details` text DEFAULT NULL,
  `date_added` datetime DEFAULT current_timestamp(),
  PRIMARY KEY (`studpack_id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=latin1;

/*Data for the table `tbl_studentpackages` */

insert  into `tbl_studentpackages`(`studpack_id`,`student_id`,`invoice_id`,`package_id`,`details`,`date_added`) values (1,1,1,8,'{\"detail\": \"26 days\", \"sessions_attended\": 1}','2020-03-15 00:04:44');

/*Table structure for table `tbl_studentpromotions` */

DROP TABLE IF EXISTS `tbl_studentpromotions`;

CREATE TABLE `tbl_studentpromotions` (
  `promotion_id` int(11) NOT NULL AUTO_INCREMENT,
  `student_id` int(11) DEFAULT NULL,
  `rank_id` int(11) DEFAULT NULL,
  `ses_attended` int(11) DEFAULT NULL,
  `next_rank` text DEFAULT NULL,
  `photo` blob DEFAULT NULL,
  `remarks` varchar(255) DEFAULT NULL,
  `eval_technique` text DEFAULT NULL,
  `eval_attitude` text DEFAULT NULL,
  `eval_remarks` text DEFAULT NULL,
  `date_promoted` datetime DEFAULT current_timestamp(),
  PRIMARY KEY (`promotion_id`)
